def extract_polygon(dataframe: gpd.GeoDataFrame, save: bool = False) -> gpd.GeoDataFrame:
    saving_dir = join(REGBL_DATA_DIR, "footprint.gpkg")
    dataframe.geometry = dataframe.geometry.apply(
        lambda multipolygon: cascaded_union(multipolygon)
    )
    if save:
        dataframe.geometry.to_file(saving_dir, driver="GPKG", layer="Floor")
    return dataframe.geometry

